import { styled } from "styled-components"
import HavBar from "../../LargeParts/NavBar/NavBar"

const StyledMain = styled.main`
  display: flex;
  flex-direction: column;
  //   align-items: center;
  padding-top: 50px;
  padding-bottom: 50px;
  flex-grow: 1;
  background-color: red;
`

export default function Main() {
  return (
    <StyledMain>
      <HavBar />
    </StyledMain>
  )
}
